#!/usr/bin/python3
from Crypto.Util.number import inverse


e=65537




phi = (p - 1) * (q - 1)
d = inverse(e, phi)

e1 = d  % (p-1)
e2 = d % (q-1)
coeff = (q**-1) % p

file = "asn1=SEQUENCE:rsa_key\n[rsa_key]\nversion=INTEGER:0\nmodulus=INTEGER:%d\npubExp=INTEGER:%d\nprivExp=INTEGER:%d\np=INTEGER:%d\nq=INTEGER:%d\ne1=INTEGER:%d\ne2=INTEGER:%d\ncoeff=INTEGER:%d\n" % (n,e,d,p,q,e1,e2,coeff)

with open('privkey.asn1', 'w') as f:
    f.write(file)

print('ASN file create')
